E_D("replace into `zgjm_data` values('7054','宴会','\n                <p>关于“梦见参加宴会（聚餐吃饭）”的解释：・ 梦见参加宴会（聚餐吃饭），这是一个好梦，如果在宴会上吃的是山珍海味、喝的是陈年佳酿，表示你在事业上会大有收获，财富不断累积，而且和朋友也处的很好。 周公解梦关于“梦见参加宴会（聚餐吃饭）”的相关梦境及解释：・ 梦见参加婚礼，表示你没有办法决定了就去做的人，所以常常会丧失很多好机会，你自己也很后悔。而如果梦中是在观看别人的婚礼，表示家人会有好运降临，你本身也有一段安逸顺心的日子。 ・ 梦见与朋友一起吃饭，表示健康方面亮起红灯。很可能把身体搞坏而躺在病锡上。对过度劳累、暴饮暴食等要特别小心。 ・ 梦见参加宴会（聚餐吃饭），这是一个好梦，如果在宴会上吃的是山珍海味、喝的是陈年佳酿，表示你在事业上会大有收获，财富不断累积，而且和朋友也处的很好。 ・ 梦见与家人吃饭，表示你最近的收入会接二连三的锦囊日饱，但要注意不可以因为冲动而乱买东西，浪费了你的辛苦钱。 ・ 梦到去参加葬礼，表示你会事事如意，例如遗失的东西会再找回来，而反目的朋友们也会言归于好。 ・ 梦见在家里与家人一起吃饭，表示金钱运上升。可以期待收入不断增加，口袋中绰绰有余。不过，要注意不可凭一时的冲动而买些没用的东西。 ・ 梦见参加结婚喜宴，表示爱情方面处于停滞状态。为了小事与情人吵架，……因为双方都倔强，所以始终找不到和好的机会。这时，你不妨先让步试试看。 ・ 梦见与情人吃饭，这是爱情衰运的凶兆，表示你的情人会对你挑挑拣拣，而且还会做出无理的要求，最后可能会离开你。 ・ 梦见与情人一起吃饭，表示爱情运衰败的前兆。对方的缺点将越来越觉得不能接受，你会觉得讨厌。如果想要继续培养爱情，最重要的将是你的宽容大量。 ・ 梦见在高级餐厅中吃饭，表示游乐方面的吉兆。尤其是在郊外游玩，你将会很幸运。 ・ 梦见自己参加战斗，表示意味着失恋或生意亏损。 ・ 梦见跟鬼吃饭，表示你的身体状况不大好，即使是小病也要重视，否则将会变成急症，让你痛苦不堪。 ・ 梦见狗在吃饭，表示一帆风顺，万事都很如意。如果你觉得零用钱太少，这是请求增加零用钱的时机。 ・ 梦见在大众餐厅吃饭，表示学习成绩进退不稳。期中考试可能会有优异的成绩，但期末考却将一蹶不振。 ・ 梦见与已经死了的人进餐，表示会长寿。 ・ 梦见在吃饭（乐透数字），所代表的数字是「02」 &lt;&lt;乐透数字仅供参考&gt;&gt; ・ 梦见与几个人一同进餐，但是他们却不吃，表示灾祝会降临，或要离开人世。 ・ 梦见参加舞会，舞会里的人穿的都很正式，音乐也相当悦耳，这是个好预兆，好运也会降临。但如果你梦中情绪低落，不想跳舞，表示你的人际关系很糟，几乎没有能谈心的朋友。 ・ 梦见参加诗歌朗诵比赛，表示找工作十分艰难。 ・ 梦见用银盘子吃饭，表示会大吉大利。 ・ 梦见和别人一块儿进餐，表示家里或邻居要办婚事。 ・ 梦见一人独自坐在墙上吃饭，表示会被擢升。 ・ 梦见被邀请参加朋友家的派对，表示行为方面的运势有下降的趋向。由于你的言行太轻率，所以可能出尽洋相。还可能发生其他尴尬的事情，所以要特别谨慎。 ・ 梦见自己独自用餐，表示家里要发生争吵。 ・ 男人梦见参加男女宗教大会，或祈祷大会，表示不久会被病魔缠身。 ・ 梦见没有参加野餐聚会，表示家里会有人患重病或死亡。 ・ 梦见参加节日游行，是表示你的爱情运势会上升，将会有很多人要求跟你约会，让你不知所措。这时你大可不用先挑选，可以每个都观察看看，最后再来选择。 ・ 政治领导人梦见加入政治或宗教游行，表示会受到国家领导人的尊重。 ・ 梦见宴会厅，大家围坐在饭桌旁边，来的客人都是盛装打扮，表示你目前所烦恼的事情，会随着社会变叱而好转。 ・ 梦见在高级餐?吃饭，表示你近日如果可以出游、或是外出，可能会碰上意外的好运，让你开心不已。 ・ 梦见参加政治或宗教游行，表示会有好消息。 ・ 已婚女人梦见参加迎亲队伍，表示不久会怀孕，能生一个漂亮的男孩。 ・ 已婚男人梦见参加迎亲队伍，表示会身居高位，人们都有求于自己。 ・ 病人梦见参加迎亲队伍，表示病情会恶化。 ・ 梦见在摩天大楼的餐厅用餐，表示金钱运普普通通。零用钱收入稳定，支出的金额越来越小……所以，钱比较富裕，这是存钱的大好机会。 ・ 学生梦见参加野餐，表示考试常常落第，前途受到影响。 ・ 梦见夫妻出席宴会，表示夫妻俩将有一段时间的别离，但这对你并不是一件坏事。 ・ 病人梦见参加比赛，表示会长期卧床不起。 ・ 工作人员梦见参加比赛，表示会被停职，有可能被辞退。 ・ 梦见参加比赛，表示是不祥之兆。 ・ 梦见宴会上炊俱和吃的东西到处乱放，表示家里将会发生争吵。 ・ 旅游者梦见参加政治或宗教游行，表示会发生车祸。 ・ 已婚女人参加野餐，表示会受到丈夫家其他女人的冷眼和辱骂。 ・ 病人梦见参加野餐，表示身体不久就会康健。 ・ 未婚男子梦见参加迎亲队伍，表示会与恋人各奔东西。 ・ 军官梦见参加修筑铁路，表示这是吉兆，能战胜敌人。 ・ 商人梦见加入比赛，表示开始做新的生意，要损失许多钱财。 ・ 商人梦见参加野餐，表示生意会受到挫折。 ・ 男人梦见参加野餐，表示是祥兆，会身体健康，精神振奋。 ・ 梦见带着烟斗去参加大会，表示会德高望众。</p>\n              ','355','257','http://www.bazi5.com','0','0','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7055','喝水','\n                <p>喝水主健康。水是生命的源泉，喝水在梦中代表了人的健康状况。</p><p>梦见自己喝清水，会身体强壮。</p><p>梦见喝非常甜的饮料，则意味着疾病的困扰</p>\n              ','355','165','http://www.bazi5.com','0','0','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7056','骂人','\n                <p>梦见有人言辞激烈地说脏话，表示你心中可能有一直压抑着的愤怒，或焦虑。</p><p>梦见自己骂别人或是被别人骂，代<a href=\"http://www.bazi5.com/zgjm.html\">表</a>你会跟别人起冲突。</p><p>梦见自己和别人对骂，则表示你性格能屈能伸，能走出逆境。</p><p>梦见骂已经去世的人，暗示可能会生病。</p><p>丈夫梦见自己骂妻子，还可能暗示家里会破财，或是丢东西。</p>\n              ','355','1644','http://www.bazi5.com','0','0','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7057','戴孝','\n                <p>梦见自己戴孝，代<a href=\"http://www.bazi5.com/zgjm.html\">表</a>运气不好，会很不幸。</p><p>梦见别人戴孝，表示在你的朋友中将有令人担忧的不好的影响，这是你没有想到的，这将给你带来一定的损失。</p><p>对于相爱中的人，此梦代<a href=\"http://www.bazi5.com/zgjm.html\">表</a>相互之间的误解，很可能要分手。</p>\n              ','355','227','http://www.bazi5.com','0','0','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7058','冰窟窿','\n                <p>梦见冰，会得到别人的支持。女人梦见得到了冰，家境会富裕。姑娘梦见冰，会找到一位称心如意的对象。学生梦见得到冰，考试会取得优异的成绩。梦见冰化了，会失去支持者。小伙子梦见得到冰，恋人会对他同心同德，对他忠贞不渝。商人梦见得到冰生意会兴旺。农民梦见得到冰，庄稼会丰收。恋人梦见在滑冰，生意会萧条。小伙子梦见滑冰，恋人会朝三暮四，最终会抛弃自己。士兵梦见在滑冰，会有生命危险，也许会阵亡。<br />梦见冰窟窿：一般是好的兆头。<br />年轻人梦见冰窟窿主健康：精神状况出现好转。身体状况也较为稳定，但是有可能遇到刀伤、感冒之类的小麻烦。</p>\n              ','355','73','http://www.bazi5.com','0','0','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7059','发洪水','\n                <p>我梦见家乡发很大的洪水，好担心，差点就吓醒来，这是寓意什么？，几乎把怎个村庄都淹没了，我和侄女拼命的跑，可根本没有地方跑，后来好不容易跑到一做桥上，我侄女不知道从哪里拿来了一个苹果，分给我吃了一小片，也给别人分了一些，后来又往河里丢了一片，那洪水突然退了。水退了之后我就到处找我姐姐，怎么也找不到，我家人也不见了。后来还梦到了同学，同事。。。。一怎个晚上都在做梦，有些记得清楚有些记不清楚，真是烦死了，要么就睡不着，一但睡着了就做些乱七八招的梦，请问我是不是得了失眠多梦的病啊，</p>\n              ','355','976','http://www.bazi5.com','0','1','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7060','买车','<p>梦中的车子代表一种让人向往的生活，越好的车代表生活条件越好，</p>_ueditor_page_break_tag_<p>这是内心的愿望，梦中实现时也会觉得心情高兴。</p>','355','729','http://www.bazi5.com','0','1','2016-10-03 16:58:48','','');");
E_D("replace into `zgjm_data` values('7061','梦到被人穷追不舍','<p><img src=\"/img/upload/image/20161027/1477561974149484.png\" title=\"1477561974149484.png\" alt=\"baoweiluobo.png\"/>一个好像乞丐，又像收破烂的，我发现他之后就一直看着我，然后就跟住我，我就越走越快，走到家里去，还是被他跟住，后来还跑到楼上，他也跟上来，然后我就不22跑了，他慢慢的走过来，这时候我被吓醒了，那个朋友能给我解<a href=\"http://www.bazi5.com/zgjm.html\" target=\"_blank\">解梦</a>？这种情况是表示今天能走运？连甩都甩不掉吗！？呵呵 .<a href=\"http://www.bazi5.com/zgjm/renwu.html\" target=\"_blank\">人物篇解梦</a><br/><img alt=\"梦到被人穷追不舍\" src=\"http://www.bazi5.com/app/jm/1252.jpg\"/></p>','350','2649','http://www.bazi5.com','0','1','2016-10-03 16:57:50','','');");
